const NoPage = () => {
  return (
    <>
      {/* <!-- Content Wrapper. Contains page content --> */}
      {/* <!-- Content Header (Page header) --> */}
      {/* <!-- Main content --> */}
      <section class="content">
        <div class="error-page">
          <h2 class="headline text-warning"> 404</h2>
          <div class="headline error-content">
            <h3>
              <i class="fas fa-exclamation-triangle text-warning"></i> Oops!
              Page not found.
            </h3>
          </div>
          {/* <!-- /.error-content --> */}
        </div>
        {/* <!-- /.error-page --> */}
      </section>
      {/* <!-- /.content --> */}
      <section id="wrapper" class="error-page">
        <div class="error-box">
          <div class="error-body text-center">
            <h1 class="text-danger">404</h1>
            <h3 class="text-uppercase">Page Not Found !</h3>
            <p class="text-muted m-t-30 m-b-30">
              YOU SEEM TO BE TRYING TO FIND HIS WAY HOME
            </p>
            <a
              href="index.html"
              class="btn btn-danger btn-rounded waves-effect waves-light m-b-40"
            >
              Back to home
            </a>{" "}
          </div>
          <footer class="footer text-center">2017 Â© Ample Admin.</footer>
        </div>
      </section>
    </>
  );
};

export default NoPage;
